import { Component } from "react";
import "./navbar.css";


class NavBar extends Component{
    render(){
        return(
            <div className="component-1-1">
      <div className="rectangle-5" />
      <p className="text-1">Home</p>
      <p className="text-2">About</p>
      <div className="component-1-0">
        <div className="rectangle-7" />
        <p className="text-3">Login</p>
      </div>
      <p className="text-4">SkillAdhyan</p>
      <div className="component-9">
        <div className="rectangle-6" />
        <p className="text-5">Search for courses</p>
      </div>
    </div>
        );
    }
}

export default NavBar;
